local t = 0
local idx = 1
local lastValidCFrame = cam.CFrame  -- fallback awal

RunService.RenderStepped:Connect(function(dt)
    t += dt
    
    local lastTime = frames[#frames].Time
    if t > lastTime + 0.1 then return end  -- sedikit toleransi
    
    -- maju index sampai berada di interval yang benar
    while idx < #frames and t >= frames[idx + 1].Time do
        idx += 1
    end
    
    if idx >= #frames then
        -- sudah sampai akhir  freeze di pose terakhir
        cam.CFrame = lastValidCFrame
        return
    end
    
    local a = frames[idx]
    local b = frames[idx + 1]
    
    if not (a and b) then return end
    
    local alpha = (t - a.Time) / (b.Time - a.Time)
    alpha = math.clamp(alpha, 0, 1)
    
    -- Interpolate semua properti
    local pos    = a.Pos:Lerp(b.Pos, alpha)
    local vel    = a.Vel:Lerp(b.Vel, alpha)
    local move   = a.Move:Lerp(b.Move, alpha)
    local fov    = a.FOV + (b.FOV - a.FOV) * alpha
    local cf     = a.CFrame:Lerp(b.CFrame, alpha)
    
    lastValidCFrame = cf
    
    cam.CFrame = cf
    cam.FieldOfView = fov
    
    -- Align karakter menghadap arah kamera (flat)
    local lookFlat = Vector3.new(cf.LookVector.X, 0, cf.LookVector.Z)
    if lookFlat.Magnitude > 0.001 then
        lookFlat = lookFlat.Unit
        hrp.CFrame = CFrame.new(pos, pos + lookFlat * 10)
    end
    
    hum:Move(move, true)
    hrp.AssemblyLinearVelocity = vel
    
    -- Jump logic (simple cross-frame)
    if a.Jump or b.Jump then
        if alpha < 0.5 and a.Jump or alpha >= 0.5 and b.Jump then
            hum.Jump = true
        end
    end
end)
